import ImageEditor from './ImageEditor';

const EditorList = ({ props }) => {

    return (
        <div>
            Lala

        {props.map((item, index) => {
            return (
                <div>
                    <ImageEditor key={index} props={item} />
                    <div> {index} </div>
                </div>
            )
        })}
        </div>

    );
}


export default EditorList;
